    const getEyeClass = useCallback(
      eyeWinking => {
        if (rollingEyes) {
          return Eye_Class.ROLL
        }

        if (lookingUp) {
          return Eye_Class.LOOK_UP
        }

        if (leftEyeWink || rightEyeWink) {
          return eyeWinking ? Eye_Class.WINK : ''
        }

        if (blinking) {
          return Eye_Class.BLINK
        }

        return ''
      },
      [blinking, rollingEyes, lookingUp, leftEyeWink, rightEyeWink]
    )

    const mouthClass = talking
      ? Mouth_Class.TALK
      : smiling
      ? Mouth_Class.SMILE
      : pouting
      ? Mouth_Class.POUT
      : ''

    const bodyClass = !breathing
      ? ''
      : talking
      ? Body_Class.TALK
      : Body_Class.BREATH

    const leftEyeClass = getEyeClass(leftEyeWink)

    const rightEyeClass = getEyeClass(rightEyeWink)

